ئلة </p>\\n\\n<p style=\\\"text-align:center\\\">- استخدام الزهر وتحديد الرقم دون عد النقاط </p>\\n\\n<p style=\\\"text-align:center\\\">- صعود الدرجات  اثنيتن اثنتين   مع عدها</p>\\n\\n<p style=\\\"text-align:center\\\">- التسوق معك  و مناقشة الكميات المستوجب شراءها و المبلغ المتوجب دفعه و العملة المعادة </p>\\n\"},\"subContentId\":\"052a9562-a7d8-4cd3-9d77-a7a618de39b8\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":75,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":53.726169844021,\"y\":58.461538461538,\"width\":40.031397174254,\"height\":24.581005586592,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><span style=\\\"color:#2ecc71\\\"><strong>4. وخاصة:</strong></span></p>\\n\\n<p style=\\\"text-align:center\\\">لا تحمل طفلك مزيدا من الأعمال الحسابية مما يجعله يكره الرياضيات</p>\\n\"},\"subContentId\":\"b90386da-212b-4ff6-855d-c2adf2a0b653\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":75,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":53.726169844021,\"y\":9.2307692307692,\"width\":40.034662045061,\"height\":39.384615384615,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><span style=\\\"color:#2ecc71\\\"><strong>3. مع  المعلمين :</strong></span></p>\\n\\n<p style=\\\"text-align:center\\\"> ناقش مع المعلمين بشأن التعديلات : </p>\\n\\n<p style=\\\"text-align:center\\\">السماح باستعمال الآلة الحاسبة في الصف مثلا أو الأدوات التي يقترحها المعالجون </p>\\n\\n<p style=\\\"text-align:center\\\">المسارات المختلفة لمتابعة دراسته</p>\\n\"},\"subContentId\":
